library(arealDB)
library(tabshiftr)
library(magrittr)
library(checkmate)


# script arguments ----
#
thisNation <- "Indonesia"
faoBuilt <- FALSE
updateTables <- TRUE
overwriteTables <- TRUE

assertSubset(x = thisNation, choices = countries$label) # ensure that nation is valid
assertLogical(x = normalise, len = 1)                  # ensure that normalise is set
assertLogical(x = faoBuilt, len = 1)                   # ensure that faoBuilt switch available


