if(normalise){

  # first check whether fao has been built, including the GADM basis ...
  if(!faoBuilt){

    # only needed if GADM basis has not been built before
    normGeometry(nation = thisNation,
                 pattern = "gadm",
                 outType = "gpkg",
                 update = updateTables)

    # only needed if FAO datasets have not been integrated before
    normTable(luckinetID = list(commodities = "target"),
              nation = thisNation,
              pattern = "fao",
              source = "datID",
              outType = "rds",
              update = updateTables)

  }

  # 4. normalise geometries ----
  #
  normGeometry(nation = thisNation,
               pattern = "",
               outType = "gpkg",
               update = updateTables)


  # 5. normalise census tables ----
  #
  ## in case the output shall be examined before writing into the DB
  # testing <- normTable(luckinetID = list(commodities = "target"),
  #                      nation = thisNation,
  #                      update = FALSE,
  #                      keepOrig = TRUE)

  normTable(luckinetID = list(commodities = "target"),
            nation = thisNation,
            pattern = "crops",
            source = "datID",
            outType = "rds",
            update = updateTables)

}
